column135:
Wellness Activities included: 
1) 30th Annual Red Ribbon Multi-Cultural Relay involving the San Felipe Community and San Felipe Elementary School students and staff spread awareness of drug and alcohol abuse, suicide risk behaviors, school violence and depression (p. 2); 
2) Children's Mental Health Awareness Month activities, which included experiential education, team building, social skills building, mental health awareness promotion, substance use prevention, suicide prevention and other topics regarding mental health, reached 228 students total (p. 2, 5); 
3) Honoring Native Life Clearinghouse's Youth Summit, which engaged youth leaders in positive role modeling, skills building, mental health promotion, etc (p. 2); 
4) Youth Leaders Skills Building series taught 16 youth leaders how to speak and promote mental health and well-being and Project Venture activity facilitation; (p. 5); 
5) Wilderness Experiential Camp taught 14 youth about peer support and engagement for suicide prevention, etc. (p. 5); 6) KYLI Experiential Day taught youth leadership values to 13 youth (p. 5); 
6) Project Venture programming in different schools provided experiential education activities related to leadership and communication skills building among peers (p. 5-7).
7) Santa Fe Indian School Wellness Project promoted healthy lifestyles for128 students (p. 7)
